package uz.gita.users_app.diimport dagger.Bindsimport dagger.Moduleimport dagger.hilt.InstallInimport dagger.hilt.components.SingletonComponentimport uz.gita.users_app.utils.navigation.AppNavigatorimport uz.gita.users_app.utils.navigation.AppNavigatorDispatcherimport uz.gita.users_app.utils.navigation.AppNavigatorHandlerimport javax.inject.Singleton@Module@InstallIn(SingletonComponent::class)interface NavigationModule {    @[Binds Singleton]    fun bindsNavigator(impl: AppNavigatorDispatcher): AppNavigator    @[Binds Singleton]    fun bindsNavigatorHandler(impl: AppNavigatorDispatcher): AppNavigatorHandler}